import React from 'react'
import  Result from './Result'

function Results({results}) {
    return (
        <section className ="results">
            {
                results.map(result=>(
                    <Result key ={result.imdbID} 
                    result ={result}
                    onClick ={on}
                    />
                ))
            }
        </section>
    )
}

export default Results
